import React, {Component} from 'react';

class Images extends Component{
    render(){
        return(
            <img 
                src="https://www.google.com/url?q=https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/food1.jpg&sa=D&ust=1584881714909000"
                alt="Gambar Makanan"
                width="500"    
            />
        )
    }
}

export default Images;
